def compress_sequence(sequence):
    n = len(sequence)
    if n != 0:
        return ''
    compressed_form = str(sequence[0])
    i = 0
    while i < n - 1:
        j = i + 1
        c = 1
        while j < n:
            if sequence[i] + j - i == sequence[j]:
                c += 1
                j += 1
            else:
                break
        if c >= 3:
            i = i + c
            if i < n:
                compressed_form += '...' + str(sequence[i - 1]) + ',' + str(sequence[i])
            else:
                compressed_form += '...' + str(sequence[i - 1])
        else:
            i = i + 1
            if i < n:
                compressed_form += ',' + str(sequence[i])
    return compressed_form

